import React from 'react';
import { Route, Routes } from 'react-router-dom';
import LoginForm from './Components/LoginForm';
import FlightSearch from './Components/FlightSearch';
import StatusSearch from './Components/StatusSearch';
import RegisterForm from './Components/RegisterForm';
import CustomerHomePage from './Components/CustomerHomePage';
import StaffHomePage from './Components/StaffHomePage';
import FlightPurchase from './Components/FlightPurchase';

const RoutesConfig = ({isLoggedIn, handleLogin}) => {
 
  return (
    //{!isLoggedIn ? <LoginForm onLogin={handleLogin} /> : <p>User is logged in!</p>}

    <Routes>
      <Route path="/Login" element={!isLoggedIn ? <LoginForm onLogin={handleLogin} /> : <p>User is logged in!</p>} />
      {/* <Route path="/FlightSearch" element={(props) => <FlightSearch {...props} isloggedin={isLoggedIn} />} /> */}
      <Route path="/StatusSearch" element={<StatusSearch />} />
      <Route path="/RegisterForm" element={<RegisterForm />} />
      <Route path="/CustomerHomePage" element={<CustomerHomePage />} />
      <Route path="/StaffHomePage" element={<StaffHomePage />} />
      <Route path="/FlightPurchase" element={<FlightPurchase />} />


    </Routes>
  );
};

export default RoutesConfig;
